import React from 'react';
import AdminNavigation from '../../components/AdminNavigation'
import {Table} from 'react-bootstrap';

class VaccineRecord extends React.Component {

constructor(){
    super();
    this.state={
        items:[],
        isLoaded:false,
    }
}
  componentDidMount() {
    const apiUrl = 'http://localhost:3001/vaccine';
    fetch(apiUrl)
      .then((response) => response.json())
      .then(json =>{
          this.setState({
              isLoaded:true,
              items : json
          })
      })}
    //   console.log('This is your data', data));
    
  render() {
    var { isLoaded, items} = this.state;
    if(!isLoaded){
        return <div>Loading....</div>
    }
    else{
    return( 
        <div>
          <AdminNavigation />
    <h1>my Component has Mounted, Check the browser 'console' </h1>



    {/* <ul style={{marginLeft:400}}>
        {items.map(item =>(
            <li key={item.id}>

                Vaccine_id:{item.vaccine_id}
                   Vaccine Name:{item.title}
                   Manufacturer:{item.manf}
                   BactchNo:{item.batch}
                   Production Date:{item.p_date}
                   Vaccination Center Id:{item.vc_id}
                   Vaccine Availability:{item.available}
            </li>

            
        ))}
    </ul> */}

    {/* {
        this.state.data ?
        this.state.data.map((item,i)=>
        <div><p>
        {i}--
        {item.vaccine_id}
        {item.title}
        </p></div>)
        :
        null
    } */}





<Table striped bordered hover size="sm" style={{margin:200}}>
<thead>
     
     <tr>
       <th>Vaccine_id</th>
       <th>Vaccine Name</th>
       <th>Vaccine Manufacturer</th>
       <th>Vaccine BatchNo</th>
       <th>Production Date</th>
       <th>Expiry Date</th>
       <th>Vaccine Availability</th>
     </tr>
   </thead>
  <tbody>
      {items.map(item =>(
        <tr  key={item.id}>
          <td>{item.vaccine_id}</td>
          <td>{item.title}</td>
          <td>{item.manf}</td>
          <td>{item.batch}</td>
          <td>{item.p_date}</td>
          <td>{item.vc_id}</td>
          <td>{item.available}</td>
        </tr>
          ))}
      </tbody>
</Table>

</div>
    )
}
  }
}
export default VaccineRecord;
